import {
  Container,
  createTheme,
  ThemeProvider,
  Grid,
  TextField,
  Typography,
  Button,
} from "@mui/material";
import { useNavigate } from "react-router-dom";

const customTheme = createTheme({
  palette: {
    primary: { main: "#6D5D6E" },
    secondary: { main: "#4F4557" },
  },
});

const Header = () => {
  const navigate = useNavigate();

  const handleClickHome = async () => {
    navigate("/");
  };

  return (
    <ThemeProvider theme={customTheme}>
      <Container
        sx={{
          height: "10vh",
          minWidth: "100%",
        }}
      >
        <Grid
          container
          direction="row"
          justifyContent="right"
          alignItems="right"
          sx={{
            color: "white",
            height: "15vh",
          }}
        >
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Button onClick={() => handleClickHome()}>
              <Typography textTransform="none" color="secondary" variant="h6">
                Projects
              </Typography>
            </Button>
          </Grid>
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Button onClick={() => handleClickHome()}>
              <Typography textTransform="none" color="secondary" variant="h6">
                About Me
              </Typography>
            </Button>
          </Grid>
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Button onClick={() => handleClickHome()}>
              <Typography textTransform="none" color="secondary" variant="h6">
                Contact
              </Typography>
            </Button>
          </Grid>
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Button onClick={() => handleClickHome()} variant="outlined">
              Resume
            </Button>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
};

export default Header;
